import React from "react"
import '../../assets/css/Busquedas.css';

import {Container, Row, Col} from 'react-bootstrap'
import FormBusqueda from './FormBusquedas'
import SearchResult from './SearchResult'


class ComponentBusqueda extends React.Component{

  render(){
    return(
      <Container id='component_busqueda' fluid='true'>
        <Row top="xs">
          <Col xs={8}>
              <FormBusqueda />
          </Col>
          <Col xs={6}>
              <SearchResult />
          </Col>
        </Row>
      </Container>
    )
  }

}

export default ComponentBusqueda
